      background-color: #343434 !important; }
    .selected-section table tr {
      cursor: pointer; }
    .selected-section table tr:nth-child(n):hover {
      background-color: #555; }
    .selected-section table tr:nth-child(odd) {
      background-color: #343434; }
    .selected-section table tr:nth-child(even) {
      background-color: #444; }
